//方法一
var canReorderDoubled = function(A) {
    let n = A.length;
    if(n > 3000 || n%2!==0) return;
    A = A.sort((i,j)=> i-j);
    while (A.length) {
        let items = A.pop();
        if(items>=0){
            let a = items/2;
            let idx = A.indexOf(a);
            if(idx === -1) return false;
            A.splice(idx, 1);
        }else{
            let b = items*2;
            let idx1 = A.indexOf(b);
            if(idx === -1) return false;
            A.splice(idx, 1);
        }
    }
    return true;
};

// 方法二

var canReorderDoubled1 = function(arr) {
    let n = arr.length;
    if(n>3000 || n%2===1) return false;
    let count = 0;
    let m = 0;
    for(let i=0;i<n;i++){
        if(arr[i] < 0){
            arr[i] = -arr[i]
            count ++;
        }
        if(arr[i] === 0){
            m++
        }
    }
    // if(count%2 === 1 || m%2 === 1) return false;
    // arr.sort((i,j)=>i-j)
    // while(arr.length){
    //     let items = arr.shift();
    //     let double = items*2;
    //     let idx = arr.indexOf(double);
    //     if(idx === -1) return false;
    //     arr.splice(idx,1);
    // }
    return m;
}

